-- Volcando estructura para procedimiento CARGA_INICIAL_BlockChain._generar_TABLAS_VACUNAS
DELIMITER //
CREATE PROCEDURE `_generar_TABLAS_VACUNAS`()
BEGIN
	DECLARE done INT DEFAULT FALSE;

	DECLARE v_id_perro INT;	
	DECLARE v_fecha_nacimiento DATE;
	DECLARE v_numero_vacunas INT;
	
	DECLARE v_fecha_alta DATE;
	DECLARE v_max_numero_protecciones INT; 
	DECLARE v_numero_protecciones INT;

	DECLARE cursor_perros CURSOR FOR 	
		SELECT 	ID,
					FECHA_NACIMIENTO, 
					YEAR(IFNULL(FECHA_DEFUNCION, NOW()))-YEAR(FECHA_NACIMIENTO)-1	 
		FROM PERROS
		ORDER BY 1
		LIMIT 10;
				
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done=TRUE;


	TRUNCATE TABLE VACUNAS_perros;
	TRUNCATE TABLE VACUNAS_perros_proteccion;
	ALTER TABLE VACUNAS_perros_proteccion AUTO_INCREMENT = 1;
		
	OPEN cursor_perros;

	SET @rownum = 0;

	loop_perros: LOOP
	
		FETCH cursor_perros INTO v_id_perro, v_fecha_nacimiento,v_numero_vacunas;
		IF done THEN
			LEAVE loop_perros;
		END IF;
		
		SET v_max_numero_protecciones = ( SELECT COUNT(*) FROM VACUNAS_proteccion);
				
		FOR numero_vacuna IN 1..v_numero_vacunas
			DO
			
				SET v_fecha_alta = v_fecha_nacimiento +  INTERVAL ( numero_vacuna  * 365) DAY + INTERVAL ( 30 * RAND()) DAY;
							
				SELECT @rownum:=@rownum+1,
						 v_id_perro,
						 ( SELECT FLOOR(100 + (RAND() * 20))) AS ID_VETERINARIO,
						 ( SELECT LPAD (FLOOR(1 + (RAND() * 1000000000000000)),15,'0') ),
						 v_fecha_alta,
						 v_fecha_alta + INTERVAL ( 365 ) DAY;	
						 
				SET v_numero_protecciones = ( SELECT FLOOR(1 + (RAND() * v_max_numero_protecciones)));
											
				SELECT @rownum,
						 ID,
						 v_fecha_alta,
						 v_fecha_alta + INTERVAL ( 365 ) DAY
				FROM 	VACUNAS_proteccion
				ORDER BY RAND() LIMIT v_numero_protecciones;	
		END FOR;		
		
  	END LOOP;
	CLOSE cursor_perros; 
	
	SELECT * FROM VACUNAS_perros ORDER BY ID_PERRO, FECHA_ALTA; 
	SELECT * FROM VACUNAS_perros_proteccion ORDER BY ID_VACUNA_PERRO, FECHA_ALTA; 


END//
DELIMITER ;

-- Volcando estructura para procedimiento CARGA_INICIAL_BlockChain._generar_TABLA_AFIJOS
DELIMITER //
CREATE PROCEDURE `_generar_TABLA_AFIJOS`(
	IN `p_numero_afijos` INT
)
BEGIN

	TRUNCATE TABLE AFIJOS;

	SELECT ID,
			 NOMBRE,
			 CURDATE() - INTERVAL 10000 * RAND() DAY,
			 NULL
	FROM   __NOMBRES_afijos
	ORDER BY ID LIMIT p_numero_afijos;
	
	SELECT * FROM AFIJOS;

END//
DELIMITER ;

-- Volcando estructura para procedimiento CARGA_INICIAL_BlockChain._generar_TABLA_AFIJOS_propietarios
DELIMITER //
CREATE PROCEDURE `_generar_TABLA_AFIJOS_propietarios`()
BEGIN

	DECLARE numero_afijos INT;
	SET numero_afijos = ( SELECT COUNT(*) FROM AFIJOS );

	TRUNCATE TABLE AFIJOS_propietarios;
	 
	SET @id_afijo=0; 
	SELECT AFIJOS.ID AS ID_AFIJO,
			 AFIJO_PROPIETARIO.ID_PROPIETARIO, 
			 AFIJOS.FECHA_ALTA,
			 AFIJOS.FECHA_BAJA AS FECHA_BAJA
	FROM 	 AFIJOS,
			 ( SELECT @rownum:=@rownum+1 AS ID_AFIJO, 
			 			 PERSONAS_ALEATORIAS.ID AS ID_PROPIETARIO
				FROM 	(SELECT @rownum:=0) AS ORDEN, 
						( SELECT ID FROM PERSONAS ORDER BY RAND() LIMIT numero_afijos ) AS PERSONAS_ALEATORIAS
			 ) AS AFIJO_PROPIETARIO
		WHERE	AFIJOS.ID = AFIJO_PROPIETARIO.ID_AFIJO	;
	
	SELECT * FROM AFIJOS_propietarios;

END//
DELIMITER ;

