-- Volcando estructura para procedimiento CARGA_INICIAL_BlockChain._generar_TABLA_MICROCHIPS_perros
DELIMITER //
CREATE PROCEDURE `_generar_TABLA_MICROCHIPS_perros`()
BEGIN
 
  # FALTARIA DETERMINAR QUE PERSONAS SON VETERINARIOS
  
	TRUNCATE TABLE MICROCHIPS_perros;	
	
	SELECT  ID AS ID_PERRO	
			, ( SELECT ID FROM PERSONAS WHERE ID BETWEEN 100 AND 120 ORDER BY RAND() LIMIT 1 ) AS ID_VETERINARIO	
			, ( SELECT LPAD (FLOOR(1 + (RAND() * 1000000000000000)),15,'0') ) AS COD_MICROCHIP	
			, PERROS.FECHA_NACIMIENTO + INTERVAL 45 + 90 * RAND() DAY AS FECHA_ALTA
			, NULL AS FECHA_BAJA
	FROM 	PERROS
	WHERE	FECHA_NACIMIENTO IS NOT NULL
	ORDER BY ID; 
	
	SELECT * FROM MICROCHIPS_perros;
END//
DELIMITER ;

-- Volcando estructura para procedimiento CARGA_INICIAL_BlockChain._generar_TABLA_PERROS
DELIMITER //
CREATE PROCEDURE `_generar_TABLA_PERROS`(
	IN `p_numeroGeneraciones` INT
)
BEGIN
	DECLARE done INT DEFAULT FALSE;
		
	DECLARE numero_perros INT;	
	
	DECLARE v_id_afijo INT;
	DECLARE v_id_hembra INT;	
	
	DECLARE v_fecha_nacimiento DATE;
	DECLARE v_fecha_defuncion DATE;
	
	DECLARE id_macho INT;
	DECLARE fecha_nacimiento_camada DATE;
	DECLARE intervalo_fechas DATE;
		
	DECLARE cursor_afijos CURSOR FOR SELECT ID FROM AFIJOS LIMIT 5 ;
	DECLARE cursor_hembras_afijo CURSOR(p_id_afijo INT) FOR 
			SELECT	ID,
						FECHA_NACIMIENTO,
						FECHA_DEFUNCION
			FROM 		PERROS 
			WHERE 	ID_AFIJO = p_id_afijo 
			AND 		SEXO ="HEMBRA";
	
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done=TRUE;
		
	# Crear tabla de Nombres caninos

	# DROP TABLE IF EXISTS __NOMBRES_perros;

	# CREATE TABLE __NOMBRES_perros as
	# SELECT NOMBRE, "MACHO" as SEXO
	# FROM __NOMBRES_machos 
	# UNION ALL
	# SELECT NOMBRE, "HEMBRA" as SEXO
	# FROM __NOMBRES_hembras;

	TRUNCATE TABLE PERROS;
	
	# Insertar perros para pruebas


	# insertar primera generacion

	OPEN cursor_afijos;
	
	loop_primera_generacion: LOOP
	
		FETCH cursor_afijos INTO v_id_afijo;
		IF done THEN
			LEAVE loop_primera_generacion;
		END IF;
		
		FOR numero_hembras IN 1..(SELECT FLOOR(1 + (RAND() * 3)))
		DO
			SELECT NOMBRE,
					 v_id_afijo,
					 SEXO,
					 0,
					 0,
					 0,
					 CURDATE() + INTERVAL ( 365 * RAND()) DAY,
					 CURDATE() + INTERVAL ( 20*365 * RAND()) DAY
			FROM  __NOMBRES_perros 
			WHERE SEXO = "HEMBRA"
			AND	NOMBRE NOT IN ( SELECT NOMBRE FROM PERROS WHERE ID_AFIJO = v_id_afijo )				
			ORDER BY RAND() LIMIT 1;	
		END FOR;
		
		FOR numeroGeneracion IN 1..(SELECT FLOOR(1 + (RAND() * 5)))
		DO
			SELECT NOMBRE,
					 v_id_afijo,
					 SEXO,
					 0,
					 0,
					 0,
					 CURDATE() + INTERVAL ( 365 * RAND()) DAY,
					 CURDATE() + INTERVAL ( 20*365 * RAND()) DAY
			FROM  __NOMBRES_perros 
			WHERE SEXO = "MACHO" 	
			AND	NOMBRE NOT IN ( SELECT NOMBRE FROM PERROS WHERE ID_AFIJO = v_id_afijo )							
			ORDER BY RAND() LIMIT 1;	
		END FOR;
		
  	END LOOP;
	CLOSE cursor_afijos; 
	
	# insertar otras generacion
	
	FOR numeroGeneracion IN 2..p_numeroGeneraciones
	DO
	   
		SET done=FALSE;
		OPEN cursor_afijos;
		loop_otras_generacion: LOOP
			FETCH cursor_afijos INTO v_id_afijo;
			IF done THEN
				LEAVE loop_otras_generacion;
			END IF;
					
			OPEN cursor_hembras_afijo(v_id_afijo);
	
				loop_hembras_afijo: LOOP
				
					FETCH cursor_hembras_afijo INTO v_id_hembra, v_fecha_nacimiento, v_fecha_defuncion;
					IF done THEN
			      	LEAVE loop_hembras_afijo;
			    	END IF;
			   		    
			    	SET numero_perros = ( SELECT FLOOR(1 + (RAND() * 5)));
			    	SET fecha_nacimiento_camada = ( SELECT CURDATE() + INTERVAL (2*(numeroGeneracion-1)) YEAR + INTERVAL ( 365 * RAND()) DAY);
			    	SET id_macho = ( SELECT ID 
												   FROM   PERROS 
													WHERE  ID_AFIJO = v_id_afijo 
													AND    SEXO ="MACHO"
													AND    fecha_nacimiento_camada BETWEEN ( FECHA_NACIMIENTO + INTERVAL 1 YEAR ) AND FECHA_DEFUNCION 
													AND    fecha_nacimiento_camada < FECHA_NACIMIENTO + INTERVAL 12 YEAR
													ORDER BY RAND() LIMIT 1);
			    
			    	IF ( 		( fecha_nacimiento_camada <  ( v_fecha_nacimiento + INTERVAL 10 YEAR ) )
						AND	( fecha_nacimiento_camada >= ( v_fecha_nacimiento + INTERVAL 1  YEAR ) )
						AND   ( fecha_nacimiento_camada <    v_fecha_defuncion ) 
						AND   ( id_macho IS NOT NULL ) 
						) THEN
						
						FOR numero_perros_camada IN 1..( SELECT FLOOR(1 + (RAND() * 5)))
						DO
							
							SELECT NOMBRE,
									 v_id_afijo,
									 SEXO,
									 v_id_hembra,
									 id_macho,
									 0,
									 fecha_nacimiento_camada,
						 			 fecha_nacimiento_camada + INTERVAL ( 20*365 * RAND()) DAY
							FROM  __NOMBRES_perros 
							WHERE  NOMBRE NOT IN ( SELECT NOMBRE FROM PERROS WHERE ID_AFIJO = v_id_afijo )
							ORDER BY RAND() LIMIT 1;
							
						END FOR;
							
				   END IF;						
					  
				END LOOP;
				
			SET done=FALSE;
			CLOSE cursor_hembras_afijo;
						
	 	END LOOP;
		CLOSE cursor_afijos; 
		
	END FOR;		
	
	# Traspolacion de fechas
	
	UPDATE PERROS
   SET   FECHA_NACIMIENTO=FECHA_NACIMIENTO + INTERVAL (SELECT DATEDIFF ( CURDATE(), MAX(FECHA_NACIMIENTO)) FROM PERROS) DAY
  		 , FECHA_DEFUNCION=FECHA_DEFUNCION   + INTERVAL (SELECT DATEDIFF ( CURDATE(), MAX(FECHA_NACIMIENTO)) FROM PERROS) DAY;
	
	UPDATE AFIJOS
	INNER JOIN
	(	SELECT ID_AFIJO,
			 	 MIN(FECHA_NACIMIENTO) - INTERVAL ( 365 * RAND()) DAY  AS FECHA_ALTA
		FROM 	 PERROS
		WHERE  ID_AFIJO > 0
		GROUP BY ID_AFIJO
	) AS FECHAS_AFIJOS
	ON
	AFIJOS.ID = FECHAS_AFIJOS.ID_AFIJO
	SET AFIJOS.FECHA_ALTA = FECHAS_AFIJOS.FECHA_ALTA;
	  		
	# Insertar perros mestizos

	FOR numeroRegistros IN 1..100
	DO
		SELECT NOMBRE,
				 0,
				 SEXO,
				 0,
				 0,
				 0,
				 CURDATE() - INTERVAL ( 20*365 * RAND()) DAY,
				 CURDATE() - INTERVAL ( 20*365 * RAND()) DAY
		FROM __NOMBRES_perros ORDER BY RAND() LIMIT 1;	
			
	END FOR;	
	
	# Correguir fechas de defuncion no corectas
	
	UPDATE PERROS
	SET 	 FECHA_DEFUNCION = NULL
	WHERE  FECHA_DEFUNCION <= FECHA_NACIMIENTO
	OR		 FECHA_DEFUNCION >= CURDATE();
		
	# ##################
	
	SELECT * FROM PERROS;
	SELECT MAX(ID)  FROM PERROS;
	

END//
DELIMITER ;

-- Volcando estructura para procedimiento CARGA_INICIAL_BlockChain._generar_TABLA_PERROS_propietarios
DELIMITER //
CREATE PROCEDURE `_generar_TABLA_PERROS_propietarios`()
BEGIN
 
 	TRUNCATE TABLE PERROS_propietarios; 	

	SELECT	  PERROS.ID AS ID_PERRO
				, AFIJOS_propietarios.ID_PROPIETARIO
				, PERROS.FECHA_NACIMIENTO AS FECHA_ALTA
				, PERROS.FECHA_DEFUNCION AS FECHA_BAJA
				
	FROM		  PERROS
				, AFIJOS_propietarios
	WHERE 	PERROS.ID_AFIJO > 0
	AND		PERROS.ID_AFIJO = AFIJOS_propietarios.ID_AFIJO
	
	UNION
	
	SELECT	  PERROS.ID AS ID_PERRO
				, ( SELECT ID FROM PERSONAS ORDER BY RAND() LIMIT 1 ) AS ID_PROPIETARIO
				, PERROS.FECHA_NACIMIENTO AS FECHA_ALTA
				, PERROS.FECHA_DEFUNCION AS FECHA_BAJA
	FROM		PERROS
	WHERE 	PERROS.ID_AFIJO = 0;
	
	SELECT * FROM PERROS_propietarios;
END//
DELIMITER ;

-- Volcando estructura para procedimiento CARGA_INICIAL_BlockChain._generar_TABLA_PERSONAS
DELIMITER //
CREATE PROCEDURE `_generar_TABLA_PERSONAS`(
	IN `p_numeroPersonas` INT
)
BEGIN

	DECLARE dni INT;

	DROP TABLE IF EXISTS __NOMBRES_personas;

	CREATE TABLE __NOMBRES_personas as
	SELECT NOMBRE, "HOMBRE" as SEXO
	FROM __NOMBRES_hombres 
	UNION ALL
	SELECT NOMBRE, "MUJER" as SEXO
	FROM __NOMBRES_mujeres;

	TRUNCATE TABLE PERSONAS;


	FOR numeroRegistros IN 10..p_numeroPersonas
	DO
		SET dni = ( SELECT FLOOR(1 + (RAND() * 99999999)));

									  TIPO_DOCUMENTO, IDENTIFICADOR_DOCUMENTO, PAIS_EMISOR )
		SELECT NOMBRE.NOMBRE, APELLIDO_1.APELLIDO AS APELLIDO_1, APELLIDO_2.APELLIDO AS APELLIDO_2, NOMBRE.SEXO,
				 "NIF", IDENTIFICADOR_DOCUMENTO.NIF, "SPAIN"
		FROM 	
			( SELECT NOMBRE, SEXO FROM __NOMBRES_personas ORDER BY RAND() LIMIT 1) AS NOMBRE,
			( SELECT APELLIDO FROM __APELLIDOS_personas ORDER BY RAND() LIMIT 1) AS APELLIDO_1,
			( SELECT APELLIDO FROM __APELLIDOS_personas ORDER BY RAND() LIMIT 1) AS APELLIDO_2,
			( SELECT CONCAT( CAST(dni AS CHAR) , SUBSTR("TRWAGMYFPDXBNJZSQVHLCKE", MOD(dni, 23) + 1, 1)) as NIF) AS IDENTIFICADOR_DOCUMENTO;
			
	END FOR;	
	
	SELECT * FROM PERSONAS;
END//
DELIMITER ;

